import { useState } from 'react';
import React from 'react';

const Room = () => {
  const [clients, SetClients] = useState([
    {
      id : 1 ,
      name: 'Suhani',
    },
    {
      id: 2 , 
      name: 'Kirti', 
    },
  ]);
    return (
    <div>
      <h1>All connected clients</h1>
      {
        clients.map(client =>{
          return <div>
            <audio controls autoPlay></audio>
            <h4>{client.name}</h4>
          </div>
        })
      }
    </div>
  )
}

export default Room;
